let {data} = runtime.inputs();
let output = [];
for(let d of data) {
    let {ip,temp,co2,rh,aqi,id:sensor} = d;
    output.push({address:`${ip}:${temp}`,id:`${sensor}-temp`});
    output.push({address:`${ip}:${rh}`,id:`${sensor}-rh`});
    output.push({address:`${ip}:${co2}`,id:`${sensor}-co2`});
    output.push({address:`${ip}:${aqi}`,id:`${sensor}-aqi`});
}
runtime.done({data:{data:output}});

let { rooms, mappings } = runtime.inputs()

// filter romms with mapping 
let updated = rooms.map(r => {
    // get mapping 
    let mapping = mappings.find(m => m["optergy"] == r.id)

    if (mapping) {
        let t = {
            id: r.id,
            name: r.location,
            masterName: mapping.name,
            capacity: mapping.capacity
        }

        return t
    }
})

let cleaned = updated.filter(r => r != undefined)

runtime.done({ rooms: cleaned })

